import React, {Component} from 'react';

class App extends Component{
	render(){
		return(
				<div>
					<h1>Jodli Web Solutions</h1>
					<p>We are web services company</p>
					<p>Our focus is miningful projects and quality software</p>
				</div>
			)
	}
}

export default App;
